    return (
        <Box bg="yellow" w="100%" p="20px">
            <Center h="100%">
                <Flex w="70%" direction="column">
                    <Box>This is message 1</Box>
                    <Radio colorScheme="red" value="1">
                        Radio
                    </Radio>
                    <Radio colorScheme="green" value="2">
                        Radio
                    </Radio>
                </Flex>
            </Center>
        </Box>
    );
};

export default Quiz;
